import React, { useState } from "react";
import axios from 'axios';
import { useNavigate } from "react-router-dom";
import './RegisterPage.css';

export default function RegisterPage() {
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const navigate = useNavigate();

    const signUpUser = () => {
        if (email.length === 0) {
            alert("Email has left Blank!");
        } else if (password.length === 0) {
            alert("Password has left Blank!");
        } else {
            axios.post('http://127.0.0.1:5000/signup', {
                email: email,
                password: password
            })
            .then(function (response) {
                console.log(response);
                navigate("/login");
            })
            .catch(function (error) {
                console.log(error, 'error');
                if (error.response.status === 409) {
                    alert("Email already exists");
                } else {
                    alert("Signup failed. Please try again.");
                }
            });
        }
    };

    return (
        <div>
            <div className="register-container">
                <div className="register-card">
                    <form>
                        <div className="title-container">
                            <h2 className="title">Register</h2>
                            <div className="underline"></div>
                        </div>

                        <div className="input-group">
                            <span className="input-icon">👤</span>
                            <input
                                type="text"
                                value={firstName}
                                onChange={(e) => setFirstName(e.target.value)}
                                id="firstName"
                                className="input-field"
                                data-value={firstName} // Add data-value for CSS detection
                            />
                            <label htmlFor="firstName" className="input-label">First Name</label>
                        </div>

                        <div className="input-group">
                            <span className="input-icon">👤</span>
                            <input
                                type="text"
                                value={lastName}
                                onChange={(e) => setLastName(e.target.value)}
                                id="lastName"
                                className="input-field"
                                data-value={lastName}
                            />
                            <label htmlFor="lastName" className="input-label">Last Name</label>
                        </div>

                        <div className="input-group">
                            <span className="input-icon">✉️</span>
                            <input
                                type="email"
                                value={email}
                                onChange={(e) => setEmail(e.target.value)}
                                id="form3Example3"
                                className="input-field"
                                data-value={email}
                            />
                            <label htmlFor="form3Example3" className="input-label">Email</label>
                        </div>

                        <div className="input-group">
                            <span className="input-icon">🔒</span>
                            <input
                                type="password"
                                value={password}
                                onChange={(e) => setPassword(e.target.value)}
                                id="form3Example4"
                                className="input-field"
                                data-value={password}
                            />
                            <label htmlFor="form3Example4" className="input-label">Password</label>
                        </div>

                        <div className="button-container">
                            <button type="button" className="signup-button" onClick={signUpUser}>Sign Up</button>
                        </div>
                        <div className="login-text-container">
                            <p className="login-text">
                                Already Have Account? <a href="/login" className="login-link">Sign In</a>
                            </p>
                        </div>
                    </form>
                </div>
            </div>
        </div>
    );
}
